import React from 'react';
import { Swiper, SwiperSlide } from 'swiper/react';
import Users from './feedbackJson.js';
import SlideContent from 'swiperSlide.js'
import './feedback.css';


class MySwiper extends React.Component{
  render() {
    const slidecontent = Users.map(user =>
    <SlideContent
      imgsrc = {user.imgsrc}
      userName = {user.userName}
      text = {user.text}
      id = {user.id}
      />
    )
    return(
      <Swiper
        slideperview = {"3"}
      />
    )
  }
}
export default MySwiper;
